import { BufferBuilder, binaryFeatures } from './bufferbuilder';

export const BinaryPack = {
  unpack(data) {
    const unpacker = new Unpacker(data);
    return unpacker.unpack();
  },
  pack(data) {
    const packer = new Packer();
    packer.pack(data);
    const buffer = packer.getBuffer();
    return buffer;
  }
};

class Unpacker {
  private index = 0;
  private dataBuffer;
  private dataView;
  private length: number;

  constructor(data) {
    this.dataBuffer = data;
    this.dataView = new Uint8Array(this.dataBuffer);
    this.length = this.dataBuffer.byteLength;
  }

  unpack() {
    const type = this.unpack_uint8();

    if (type < 0x80) {
      const positive_fixnum = type;
      return positive_fixnum;
    } else if ((type ^ 0xe0) < 0x20) {
      const negative_fixnum = (type ^ 0xe0) - 0x20;
      return negative_fixnum;
    }

    let size;
    if ((size = type ^ 0xa0) <= 0x0f) {
      return this.unpack_raw(size);
    } else if ((size = type ^ 0xb0) <= 0x0f) {
      return this.unpack_string(size);
    } else if ((size = type ^ 0x90) <= 0x0f) {
      return this.unpack_array(size);
    } else if ((size = type ^ 0x80) <= 0x0f) {
      return this.unpack_map(size);
    }

    switch (type) {
      case 0xc0:
        return null;
      case 0xc1:
        return undefined;
      case 0xc2:
        return false;
      case 0xc3:
        return true;
      case 0xca:
        return this.unpack_float();
      case 0xcb:
        return this.unpack_double();
      case 0xcc:
        return this.unpack_uint8();
      case 0xcd:
        return this.unpack_uint16();
      case 0xce:
        return this.unpack_uint32();
      case 0xcf:
        return this.unpack_uint64();
      case 0xd0:
        return this.unpack_int8();
      case 0xd1:
        return this.unpack_int16();
      case 0xd2:
        return this.unpack_int32();
      case 0xd3:
        return this.unpack_int64();
      case 0xd4:
        return undefined;
      case 0xd5:
        return undefined;
      case 0xd6:
        return undefined;
      case 0xd7:
        return undefined;
      case 0xd8:
        size = this.unpack_uint16();
        return this.unpack_string(size);
      case 0xd9:
        size = this.unpack_uint32();
        return this.unpack_string(size);
      case 0xda:
        size = this.unpack_uint16();
        return this.unpack_raw(size);
      case 0xdb:
        size = this.unpack_uint32();
        return this.unpack_raw(size);
      case 0xdc:
        size = this.unpack_uint16();
        return this.unpack_array(size);
      case 0xdd:
        size = this.unpack_uint32();
        return this.unpack_array(size);
      case 0xde:
        size = this.unpack_uint16();
        return this.unpack_map(size);
      case 0xdf:
        size = this.unpack_uint32();
        return this.unpack_map(size);
    }
  }

  unpack_uint8() {
    const byte = this.dataView[this.index] & 0xff;
    this.index++;
    return byte;
  };

  unpack_uint16() {
    const bytes = this.read(2);
    const uint16 =
      ((bytes[0] & 0xff) * 256) + (bytes[1] & 0xff);
    this.index += 2;
    return uint16;
  }

  unpack_uint32() {
    const bytes = this.read(4);
    const uint32 =
      ((bytes[0] * 256 +
        bytes[1]) * 256 +
        bytes[2]) * 256 +
      bytes[3];
    this.index += 4;
    return uint32;
  }

  unpack_uint64() {
    const bytes = this.read(8);
    const uint64 =
      ((((((bytes[0] * 256 +
        bytes[1]) * 256 +
        bytes[2]) * 256 +
        bytes[3]) * 256 +
        bytes[4]) * 256 +
        bytes[5]) * 256 +
        bytes[6]) * 256 +
      bytes[7];
    this.index += 8;
    return uint64;
  }


  unpack_int8() {
    const uint8 = this.unpack_uint8();
    return (uint8 < 0x80) ? uint8 : uint8 - (1 << 8);
  };

  unpack_int16() {
    const uint16 = this.unpack_uint16();
    return (uint16 < 0x8000) ? uint16 : uint16 - (1 << 16);
  }

  unpack_int32() {
    const uint32 = this.unpack_uint32();
    return (uint32 < Math.pow(2, 31)) ? uint32 :
      uint32 - Math.pow(2, 32);
  }

  unpack_int64() {
    const uint64 = this.unpack_uint64();
    return (uint64 < Math.pow(2, 63)) ? uint64 :
      uint64 - Math.pow(2, 64);
  }

  unpack_raw(size) {
    if (this.length < this.index + size) {
      throw new Error('BinaryPackFailure: index is out of range'
        + ' ' + this.index + ' ' + size + ' ' + this.length);
    }
    const buf = this.dataBuffer.slice(this.index, this.index + size);
    this.index += size;

    //buf = util.bufferToString(buf);

    return buf;
  }

  unpack_string(size) {
    const bytes = this.read(size);
    let i = 0, str = '', c, code;

    while (i < size) {
      c = bytes[i];
      if (c < 128) {
        str += String.fromCharCode(c);
        i++;
      } else if ((c ^ 0xc0) < 32) {
        code = ((c ^ 0xc0) << 6) | (bytes[i + 1] & 63);
        str += String.fromCharCode(code);
        i += 2;
      } else {
        code = ((c & 15) << 12) | ((bytes[i + 1] & 63) << 6) |
          (bytes[i + 2] & 63);
        str += String.fromCharCode(code);
        i += 3;
      }
    }

    this.index += size;

    return str;
  }

  unpack_array(size) {
    const objects = new Array(size);
    for (let i = 0; i < size; i++) {
      objects[i] = this.unpack();
    }
    return objects;
  }

  unpack_map(size) {
    const map = {};
    for (let i = 0; i < size; i++) {
      const key = this.unpack();
      const value = this.unpack();
      map[key] = value;
    }
    return map;
  }

  unpack_float() {
    const uint32 = this.unpack_uint32();
    const sign = uint32 >> 31;
    const exp = ((uint32 >> 23) & 0xff) - 127;
    const fraction = (uint32 & 0x7fffff) | 0x800000;
    return (sign == 0 ? 1 : -1) *
      fraction * Math.pow(2, exp - 23);
  }

  unpack_double() {
    const h32 = this.unpack_uint32();
    const l32 = this.unpack_uint32();
    const sign = h32 >> 31;
    const exp = ((h32 >> 20) & 0x7ff) - 1023;
    const hfrac = (h32 & 0xfffff) | 0x100000;
    const frac = hfrac * Math.pow(2, exp - 20) +
      l32 * Math.pow(2, exp - 52);
    return (sign == 0 ? 1 : -1) * frac;
  }

  read(length: number) {
    const j = this.index;

    if (j + length <= this.length) {
      return this.dataView.subarray(j, j + length);
    }

    throw new Error('BinaryPackFailure: read index out of range');
  }
}

class Packer {
  private readonly bufferBuilder = new BufferBuilder();

  getBuffer() {
    return this.bufferBuilder.getBuffer();
  }

  pack(value) {
    const type = typeof (value);

    if (type == 'string') {
      this.pack_string(value);
    } else if (type == 'number') {
      if (Math.floor(value) === value) {
        this.pack_integer(value);
      } else {
        this.pack_double(value);
      }
    } else if (type == 'boolean') {
      if (value === true) {
        this.bufferBuilder.append(0xc3);
      } else if (value === false) {
        this.bufferBuilder.append(0xc2);
      }
    } else if (type == 'undefined') {
      this.bufferBuilder.append(0xc0);
    } else if (type == 'object') {
      if (value === null) {
        this.bufferBuilder.append(0xc0);
      } else {
        const constructor = value.constructor;

        if (constructor == Array) {
          this.pack_array(value);
        } else if (constructor == Blob || constructor == File) {
          this.pack_bin(value);
        } else if (constructor == ArrayBuffer) {
          if (binaryFeatures.useArrayBufferView) {
            this.pack_bin(new Uint8Array(value));
          } else {
            this.pack_bin(value);
          }
        } else if ('BYTES_PER_ELEMENT' in value) {
          if (binaryFeatures.useArrayBufferView) {
            this.pack_bin(new Uint8Array(value.buffer));
          } else {
            this.pack_bin(value.buffer);
          }
        } else if (constructor == Object) {
          this.pack_object(value);
        } else if (constructor == Date) {
          this.pack_string(value.toString());
        } else if (typeof value.toBinaryPack == 'function') {
          this.bufferBuilder.append(value.toBinaryPack());
        } else {
          throw new Error('Type "' + constructor.toString() + '" not yet supported');
        }
      }
    } else {
      throw new Error('Type "' + type + '" not yet supported');
    }

    this.bufferBuilder.flush();
  }

  pack_bin(blob) {
    const length = blob.length || blob.byteLength || blob.size;

    if (length <= 0x0f) {
      this.pack_uint8(0xa0 + length);
    } else if (length <= 0xffff) {
      this.bufferBuilder.append(0xda);
      this.pack_uint16(length);
    } else if (length <= 0xffffffff) {
      this.bufferBuilder.append(0xdb);
      this.pack_uint32(length);
    } else {
      throw new Error('Invalid length');
    }

    this.bufferBuilder.append(blob);
  }

  pack_string(str: string) {
    const length = utf8Length(str);

    if (length <= 0x0f) {
      this.pack_uint8(0xb0 + length);
    } else if (length <= 0xffff) {
      this.bufferBuilder.append(0xd8);
      this.pack_uint16(length);
    } else if (length <= 0xffffffff) {
      this.bufferBuilder.append(0xd9);
      this.pack_uint32(length);
    } else {
      throw new Error('Invalid length');
    }
    this.bufferBuilder.append(str);
  }

  pack_array(array: Array<any>) {
    const length = array.length;

    if (length <= 0x0f) {
      this.pack_uint8(0x90 + length);
    } else if (length <= 0xffff) {
      this.bufferBuilder.append(0xdc)
      this.pack_uint16(length);
    } else if (length <= 0xffffffff) {
      this.bufferBuilder.append(0xdd);
      this.pack_uint32(length);
    } else {
      throw new Error('Invalid length');
    }

    for (var i = 0; i < length; i++) {
      this.pack(array[i]);
    }
  }

  pack_integer(num: number) {
    if (-0x20 <= num && num <= 0x7f) {
      this.bufferBuilder.append(num & 0xff);
    } else if (0x00 <= num && num <= 0xff) {
      this.bufferBuilder.append(0xcc);
      this.pack_uint8(num);
    } else if (-0x80 <= num && num <= 0x7f) {
      this.bufferBuilder.append(0xd0);
      this.pack_int8(num);
    } else if (0x0000 <= num && num <= 0xffff) {
      this.bufferBuilder.append(0xcd);
      this.pack_uint16(num);
    } else if (-0x8000 <= num && num <= 0x7fff) {
      this.bufferBuilder.append(0xd1);
      this.pack_int16(num);
    } else if (0x00000000 <= num && num <= 0xffffffff) {
      this.bufferBuilder.append(0xce);
      this.pack_uint32(num);
    } else if (-0x80000000 <= num && num <= 0x7fffffff) {
      this.bufferBuilder.append(0xd2);
      this.pack_int32(num);
    } else if (-0x8000000000000000 <= num && num <= 0x7FFFFFFFFFFFFFFF) {
      this.bufferBuilder.append(0xd3);
      this.pack_int64(num);
    } else if (0x0000000000000000 <= num && num <= 0xFFFFFFFFFFFFFFFF) {
      this.bufferBuilder.append(0xcf);
      this.pack_uint64(num);
    } else {
      throw new Error('Invalid integer');
    }
  }

  pack_double(num: number) {
    let sign = 0;
    if (num < 0) {
      sign = 1;
      num = -num;
    }

    const exp = Math.floor(Math.log(num) / Math.LN2);
    const frac0 = num / Math.pow(2, exp) - 1;
    const frac1 = Math.floor(frac0 * Math.pow(2, 52));
    const b32 = Math.pow(2, 32);
    const h32 = (sign << 31) | ((exp + 1023) << 20) |
      (frac1 / b32) & 0x0fffff;
    const l32 = frac1 % b32;

    this.bufferBuilder.append(0xcb);
    this.pack_int32(h32);
    this.pack_int32(l32);
  }

  pack_object(obj: object) {
    const keys = Object.keys(obj);
    const length = keys.length;

    if (length <= 0x0f) {
      this.pack_uint8(0x80 + length);
    } else if (length <= 0xffff) {
      this.bufferBuilder.append(0xde);
      this.pack_uint16(length);
    } else if (length <= 0xffffffff) {
      this.bufferBuilder.append(0xdf);
      this.pack_uint32(length);
    } else {
      throw new Error('Invalid length');
    }

    for (const prop in obj) {
      if (obj.hasOwnProperty(prop)) {
        this.pack(prop);
        this.pack(obj[prop]);
      }
    }
  }

  pack_uint8(num: number) {
    this.bufferBuilder.append(num);
  }

  pack_uint16(num: number) {
    this.bufferBuilder.append(num >> 8);
    this.bufferBuilder.append(num & 0xff);
  }

  pack_uint32(num: number) {
    const n = num & 0xffffffff;

    this.bufferBuilder.append((n & 0xff000000) >>> 24);
    this.bufferBuilder.append((n & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((n & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((n & 0x000000ff));
  }

  pack_uint64(num: number) {
    const high = num / Math.pow(2, 32);
    const low = num % Math.pow(2, 32);

    this.bufferBuilder.append((high & 0xff000000) >>> 24);
    this.bufferBuilder.append((high & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((high & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((high & 0x000000ff));
    this.bufferBuilder.append((low & 0xff000000) >>> 24);
    this.bufferBuilder.append((low & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((low & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((low & 0x000000ff));
  }

  pack_int8(num: number) {
    this.bufferBuilder.append(num & 0xff);
  }

  pack_int16(num: number) {
    this.bufferBuilder.append((num & 0xff00) >> 8);
    this.bufferBuilder.append(num & 0xff);
  }

  pack_int32(num: number) {
    this.bufferBuilder.append((num >>> 24) & 0xff);
    this.bufferBuilder.append((num & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((num & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((num & 0x000000ff));
  }

  pack_int64(num: number) {
    const high = Math.floor(num / Math.pow(2, 32));
    const low = num % Math.pow(2, 32);

    this.bufferBuilder.append((high & 0xff000000) >>> 24);
    this.bufferBuilder.append((high & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((high & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((high & 0x000000ff));
    this.bufferBuilder.append((low & 0xff000000) >>> 24);
    this.bufferBuilder.append((low & 0x00ff0000) >>> 16);
    this.bufferBuilder.append((low & 0x0000ff00) >>> 8);
    this.bufferBuilder.append((low & 0x000000ff));
  }
}

const _utf8Replace = (m: string) => {
  var code = m.charCodeAt(0);

  if (code <= 0x7ff) return '00';
  if (code <= 0xffff) return '000';
  if (code <= 0x1fffff) return '0000';
  if (code <= 0x3ffffff) return '00000';
  return '000000';
}

const utf8Length = (str: string) => {
  if (str.length > 600) {
    // Blob method faster for large strings
    return (new Blob([str])).size;
  }

  return str.replace(/[^\u0000-\u007F]/g, _utf8Replace).length;
}
